import React, { Component } from 'react';
import './mm_header.css';

class Header extends Component {
  render() {
    return (
      <div className= "_head">
        <Header_logo/>

        <Header_info/>
      </div>
    );
  }
}

class Header_logo extends Component {
    render() {
      return (
        <div className= "_head_elements" id="head_logo">
          <img  src="https://chargeback.com/wp-content/uploads/capital-one-logo-300x104.png" alt="Capital one"></img>
          <a href="#overview">Overview</a>
        <a href="#account_info">Account Information</a>
        </div>

      );
    }
  }

  class Header_menu extends Component {
    render() {
      return (
        <div className= "_head_elements" id="head_menu">
          <a href="#overview">Overview</a>
          <a href="#account_info">Account Information</a>
        </div>
      );
    }
  }

  class Header_info extends Component {
    render() {
      return (
        <div className= "_head_elements">
          Head info
        </div>
      );
    }
  }





export default Header;
